        <div className="cardGrid">
        {games.map(g=>{
            return(<div className="Card">
            <Link to={`/games/${id}`}>
            <GameCard key={g.id}
            name={g.name} 
            image={g.image}
            genres={g.genres.toString()}
            />
            </Link></div>)})
        }
        </div>
    )
}
